import React,{useState} from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import {Modal} from "../CustomComponents/Modal.jsx"



function CustomerOrder({order}){

  const [showModal,setShowModal]=useState(false);

  const showPopUp = () => {
    setShowModal(prev=> !prev);
  }
  //if((JSON.parse(localStorage.getItem("user"))[0]["restaurantName"]) === (dash.restaurantName))
  return(
     <div>
      <div className="container-fluid">
        <div className="card mb-12" style={{width:"100rem", objectFit:"contain"}}>
          <div className="row g-0" style={{width:"1000px",height:"150px"}}>
          <div className="col-md-12">
            <div className="card-body">
                <h5 className="card-title">{`${order.restaurant_name}`}</h5>
                <h5 className="card-text">{`${order.DISHES}`}</h5>
                <h5 className="card-text">{`${order.order_status}`}</h5>
                <h5 className="card-text">{`${order.date}`}</h5>
                <h5 className="card-text"><small className="text-muted"></small><a href="#">order receipt</a></h5>
                <Modal showModal={showModal} setShowModal={setShowModal} />
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
    )


}



export default CustomerOrder;
